import clsx from "clsx";
import { Menu, LayoutDashboard } from 'lucide-react'; // Import icons from Lucide React

const Header = () => {
    return (
        <nav className={clsx("fixed top-0 z-50 w-full bg-white", 
            "border-b border-gray-200 dark:bg-gray-800 dark:border-gray-700")}>
            <div className="px-3 py-3 lg:px-5 lg:pl-3">
                <div className="flex items-center justify-center">
                    <div className="flex items-center justify-start rtl:justify-end">
                        <button>
                            <Menu className="text-2xl"/> 
                        </button>
                        <a href="/">
                            <LayoutDashboard className="h-8 me-3 text-xl text-violet-500" /> 
                            <span>AStock</span> 
                        </a>
                    </div>
                </div>
            </div>
        </nav>
    );
};

export default Header;
